import React from 'react'
import { Container, Row ,Col,Button } from 'react-bootstrap'
import {useState,useEffect} from 'react';
import {ArrowRight} from 'react-bootstrap-icons';

export const Home = () => {
    return (
        <section className='home text-light' id='home'>
            <Container>
                <span className='tag-line'><h1 style={{fontSize:60}}>Welcome to my Portfolio</h1></span>
                <h1>{`Hi I'm `}<span className='wrap'>Web developer</span></h1>
                <p>&nbsp;I'm a Web Developer specialising in React.JS .&nbsp;
                Additionally,&nbsp;I have <br/>&nbsp;experience in HTML & CSS.&nbsp;I create Websites based on your needs.</p>
                <Button variant='link' onClick={()=> console.log('connect')}>Let's connect <ArrowRight size={25}/></Button>
            </Container>
        </section>
    )
}
